window.bookSummaryJSON = "<p>The hilarious and thought-provoking conclusion to the saga of a glitched NPC and her friends.</p> <p>As Qube and her companions reach the end of the now thoroughly broken game, they must come to grips with the nature of their reality, and the world beyond.</p> <p>Interested parties from the real world clash with our heroes as they scramble to defeat the Evil Emperor in time and reveal the secrets they’ve been keeping from one another.</p> <p>In an increasingly relevant dilemma, these video game characters, born of AI, must decide what it means to be free.</p> <p>The 3rd and final installment of a LitRPG/GameLit adventure about an NPC freed of its programming loop and brought along on a player's journey of adventure and power progression.</p> <p>About the series: Prophecy Approved Companion is a fun an often hilarious parody of old school games, Dungeons and Dragons, and every player who has ever thought “what happens if I do this...”. An original take on life inside an RPG, from the perspective of a glitched NPC.</p>"; 
